import {Component} from "react"
import "./index.css"


class MoviesList extends Component{


    onSubmit=(event)=>{
        event.preventDefault
    }

    render(){
        return(
            <div>
                <form>
                    <h1>From</h1>
                    <input type ="input"/>
                    <h1>To</h1>
                    <input type= "input"/>
                    <button type= "submit"
                    className = "button-style" onClick = {this.onSubmit}>Submit</button>
                </form>
            </div>
        )
    }
}

export default MoviesList
